import React from 'react';

const Sidebar = ({ lists, onSelectList }) => {
    return (
        <div className="sidebar">
            <ul className="list-group">
                {lists.map(list => (
                    <li key={list.id} className="list-group-item" onClick={() => onSelectList(list.id)}>
                        {list.name}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default Sidebar;
